import React from 'react';
import styles from './CardsInfo.module.scss';
import {Button} from '@mui/material';

const Index = ({setPage}) => {
  return (
    <div>
      <div className={styles.row}>
        <Button variant={'outlined'} onClick={() => setPage('AddCard')}>Додати картку</Button>
        <Button variant={'outlined'}>Додати готівку</Button>
      </div>
    </div>
  );
};

export default Index;
